addComponent(CLAZZ({

	INJECT:["entity"],

	create:function(){
		if( !this.entity.isClone )
			for( var i=10; i; i-- )
				this.entity.clone().position.y += i * 10;
	}

}))

DD8D3C14-CAB3-4A76-8D8D-4C8B081A974A.source:
addComponent(CLAZZ({
	INJECT:["entity", "asset"],
	doClone:true,

	onHitBall:function(other){
		if( !this.doClone ) return;
		this.doClone = false;

		var e = this.entity.clone();
		e.position.y += 1;
		e.position.x -= 1;
		other.clone().position.y += 1;

		this.entity.scale.y = 0.1;
	}

}))
